import React from 'react';
import { ContainerBuscador } from '../styles/contenedores';

const UserBuscador = (props) => {

    //console.log('BUSCADOR-DEBUUG', props)

    return (
        <ContainerBuscador>
            <div>
                <i className="fas fa-search"></i>
                <input type="text" onChange={props.handleSearch}/>
            </div>
        </ContainerBuscador>
    );
};

export default UserBuscador;
